// src/features/profile/UserProfile.jsx
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './UserProfile.css';
import LendingTermsEditor from './LendingTermsEditor';

export default function UserProfile() {
  const navigate = useNavigate();
  const [loading, setLoading] = useState(true);
  const [saving, setSaving] = useState(false);
  const [profile, setProfile] = useState({
    name: '',
    location: '',
    maxLoan: '',
    summary: '',
  });

  // Load my profile
  useEffect(() => {
    (async () => {
      try {
        const res = await fetch('/api/users/profile', {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
        });
        if (!res.ok) throw new Error('Failed to fetch profile');
        const data = await res.json();
        setProfile({
          name: data.name ?? '',
          location: data.location ?? '',
          summary: data.summary ?? '',
        });
      } catch (e) {
        console.error('Profile load error:', e);
      } finally {
        setLoading(false);
      }
    })();
  }, []);

  const onChange = (e) =>
    setProfile((p) => ({ ...p, [e.target.name]: e.target.value }));

  const onSubmit = async (e) => {
    e.preventDefault();
    try {
      setSaving(true);
      const body = {
        ...profile,
        // ensure number (or null)
        maxLoan:
          profile.maxLoan === '' || profile.maxLoan === null
            ? null
            : Number(profile.maxLoan),
      };

      const res = await fetch('/api/users/profile', {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${localStorage.getItem('token')}`,
        },
        body: JSON.stringify(body),
      });

      if (!res.ok) throw new Error((await res.text()) || 'Save failed');
      await res.json();
      alert('Profile updated successfully!');
      navigate('/dashboard');
    } catch (err) {
      console.error('Save failed:', err);
      alert('There was an error updating your profile.');
    } finally {
      setSaving(false);
    }
  };

  if (loading) return <div className="up-container">Loading…</div>;

  return (
    <div className="up-container">
      <h2 className="up-title">Edit Profile</h2>

      <form className="up-card" onSubmit={onSubmit}>
        <div className="up-grid">
          <div className="up-field">
            <label>Name</label>
            <input
              name="name"
              type="text"
              value={profile.name}
              onChange={onChange}
              required
              placeholder="Your full name"
            />
          </div>

          <div className="up-field">
            <label>Location</label>
            <input
              name="location"
              type="text"
              value={profile.location}
              onChange={onChange}
              placeholder="City, State (optional)"
            />
          </div>

          <div className="up-field">
            <label>Max Loan (you’re willing to lend)</label>
            <input
              name="maxLoan"
              type="number"
              min="0"
              step="10"
              value={profile.maxLoan}
              onChange={onChange}
              placeholder="e.g. 150"
            />
            <div className="up-hint">Used for lender visibility & matching.</div>
          </div>
        </div>

        <div className="up-field" style={{ marginTop: 10 }}>
          <label>Personal Summary</label>
          <textarea
            name="summary"
            rows={5}
            value={profile.summary}
            onChange={onChange}
            placeholder="Share a short intro—what you do, why you're here, and what matters to you."
          />
        </div>

        <div className="up-actions">
          <button type="button" className="action-btn" onClick={() => navigate(-1)}>
            ← Back
          </button>
          <button type="submit" className="action-btn primary" disabled={saving}>
            {saving ? 'Saving…' : 'Save Profile'}
          </button>
        </div>
      </form>

      <LendingTermsEditor />

    </div>
  );
}
